const Todo = () => {
  return (
    <div className="todo-box">
      <span>Learn ReactJS Basics</span>
      <input type="checkbox" />
      <button>
        <i class="fa-solid fa-pencil"></i>
      </button>
      <button>
        <i class="fa-solid fa-trash"></i>
      </button>
    </div>
  );
};
export default Todo;
